package com.mohey.memberservice.dto.memberupdate;import lombok.Getter;@Getterpublic class UpdateInfoRespDto {	private String memberUuid;	private String nickname;	private String selfIntroduction;	private String profile_url;	public UpdateInfoRespDto(UpdateInfoReqDto updateInfoReqDto) {		this.memberUuid = updateInfoReqDto.getMemberUuid();		this.nickname = updateInfoReqDto.getNickname();		this.selfIntroduction = updateInfoReqDto.getSelfIntroduction();		this.profile_url = updateInfoReqDto.getProfile_url();	}}